import { Fragment } from "react";
import Employee from "./components/Employee";
import { Student } from "./components/Student";

function app(){
    return (
        <Fragment>
        <nav><div>
            </div></nav>
        <Student/>
        <Employee/>
        </Fragment>
    );
}

export default app;
